import { Clan } from '../api'

import ClanTable from '../components/ClanTable'

const ClanPage = (props) => {
  console.log(props)
  return (
    <>
      <header className="p-4">
        <h1>Clan Data</h1>
      </header>
      <ClanTable {...props.clan}/>
    </>
  )
}

ClanPage.getInitialProps = async function() {
  const clan = await Clan()
  return { clan }
}

export default ClanPage
